(2, 'Hoa Kỳ', '2025-03-13 03:01:49.661000', 'Những nữ siêu anh hùng Marvel hợp sức.', 130, 'themarvel.jpg', 'English', 'themarvel.jpg', '2025-05-09 21:49:19.192881', '2025-11-10', 'PLAYING', 'The Marvels', 'https://www.youtube.com/watch?v=wS_qbDztgVY'),
