(5, 'Hoa Kỳ', '2025-03-13 03:01:49.681000', 'Người nhện và đa vũ trụ.', 148, 'spidermannowayhome.jpg', 'English', 'snwh.jpg', '2025-03-13 03:01:49.681000', '2021-12-17', 'PLAYING', 'Spider-Man: No Way Home', 'https://www.youtube.com/watch?v=JfVOs4VSpmA'),
