(10, 'Hoa Kỳ', '2025-03-13 03:01:49.732000', 'Nhiệm vụ bất khả thi của Ethan Hunt.', 156, 'mimp.jpg', 'English', 'mimp.jpg', '2025-03-13 03:01:49.732000', '2023-07-12', 'PLAYING', 'Mission: Impossible – Dead Reckoning', 'https://www.youtube.com/watch?v=fsQgc9pCyDU'),
(11, 'USA', '2025-03-13 03:02:30.147000', 'Cuộc chiến huyền thoại.', 120, 'godxkong.jpg', 'English', 'godxkong.jpg', '2025-03-13 03:02:30.147000', '2025-03-29', 'UPCOMING', 'Godzilla x Kong', 'https://www.youtube.com/watch?v=lV1OOlGwExM'),
(12, 'USA', '2025-03-13 03:02:30.160000', 'Hành trình của Paul Atreides.', 155, 'dune.jpg', 'English', 'dune.jpg', '2025-03-13 03:02:30.160000', '2025-03-01', 'PLAYING', 'Dune: Part Two', 'https://www.youtube.com/watch?v=Way9Dexny3w'),
