(14, 'USA', '2025-03-13 03:02:30.175000', 'Những cảm xúc mới xuất hiện trong tâm trí Riley.', 110, 'insideout.jpg', 'English', 'insideout2.jpg', '2025-03-13 03:02:30.175000', '2025-06-14', 'UPCOMING', 'Inside Out 2', 'https://www.youtube.com/watch?v=LEjhY15eCx0'),
(15, 'USA', '2025-03-13 03:02:30.183000', 'Chuyến phiêu lưu mới của Shrek và Donkey.', 100, 'shrek5.jpg', 'English', 'shrek5.jpg', '2025-03-13 03:02:30.183000', '2025-12-15', 'UPCOMING', 'Shrek 5', 'https://www.youtube.com/watch?v=KbiwL74KyJQ'),
(16, 'USA', '2025-03-13 03:02:30.191000', 'Một sứ mệnh không tưởng ngoài vũ trụ.', 120, 'mickey17.jpg', 'English', 'mickey17.jpg', '2025-03-13 03:02:30.191000', '2025-03-29', 'UPCOMING', 'Mickey 17', 'https://www.youtube.com/watch?v=osYpGSz_0i4'),
(17, 'USA', '2025-03-13 03:02:30.196000', 'Joker quay lại với câu chuyện điên rồ mới.', 140, 'jokerfad.jpg', 'English', 'jokerfad.jpg', '2025-03-13 03:02:30.196000', '2025-10-04', 'UPCOMING', 'Joker: Folie à Deux', 'https://www.youtube.com/watch?v=_OKAwz2MsJs'),
(18, 'USA', '2025-03-13 03:02:30.212000', 'Thế giới Pandora tiếp tục mở rộng.', 160, 'avt3.jpg', 'English', 'avt3.jpg', '2025-03-13 03:02:30.212000', '2026-12-18', 'UPCOMING', 'Avatar 3', 'https://www.youtube.com/watch?v=TNeu5EyGvq8'),
(19, 'USA', '2025-03-13 03:02:30.222000', 'Moana tiếp tục hành trình khám phá đại dương.', 105, 'moana2.jpg', 'English', 'moana2.jpg', '2025-03-13 03:02:30.222000', '2026-11-27', 'UPCOMING', 'Moana 2', 'https://www.youtube.com/watch?v=hDZ7y8RP5HE'),
(20, 'USA', '2025-03-13 03:02:30.231000', 'Biệt đội siêu anh hùng mới của Marvel.', 130, 'fan4.jpg', 'English', 'fan4.jpg', '2025-03-13 03:02:30.231000', '2026-02-14', 'UPCOMING', 'Fantastic Four', 'https://www.youtube.com/watch?v=pAsmrKyMqaA'),
(21, 'Hoa Kỳ', '2025-03-27 00:46:05.481920', 'Trước bối cảnh hậu tận thế, chú mèo xám nhút nhát, vốn luôn sợ nước phải rời bỏ vùng an toàn khi căn nhà thân yêu bị cuốn trôi bởi cơn lũ dữ. Trên hành trình vượt đại dương mênh mông, chú mèo cùng những người bạn đồng hành (Capybara, chó Labrador Retriever, Vượn Cáo, chim Thư ký) phải học cách vượt qua nỗi sợ và chấp nhận những điểm khác biệt để cùng nhau tồn tại.', 88, 'Flow.jpg', 'Tiếng Anh', 'Flow.jpg', '2025-04-22 04:46:25.321270', '2025-03-07', 'PLAYING', 'Flow', 'https://www.youtube.com/watch?v=ZgZccxuj2RY');
